import React from 'react';
import image from '../assets/1.jpg';
import Grid from "@material-ui/core/es/Grid/Grid";
import Paper from "@material-ui/core/es/Paper/Paper";
import Typography from "@material-ui/core/es/Typography/Typography";
import Button from "@material-ui/core/es/Button/Button";


function App() {
  return (
      <div>
          <div style={{
              backgroundImage : "url("+ image+")",
              backgroundSize: "cover",
              opacity: 0.8,
              filter: "grayscale(80%)",
              backgroundPosition: "top center",
              minHeight:'98vh',
              height: "auto"}}>
              <Grid
                  direction="row"
                  justify="flex-end"
                  alignItems="center"
                  container>
                  <Grid
                      style={{
                          margin:"100px 120px"
                      }}
                      item  xs={4} sm={12} md={4}>
                      <Paper elevation={3}
                      style={{
                          minHeight: 60,
                          width: '80%',
                          margin: '0px 50px',
                          position: 'relative',
                          top: 21,
                      }}>
                          <Typography>
                              We welcome`s you
                          </Typography>

                          <Typography>
                              Musix
                          </Typography>

                          <div >
                              <Button

                                  href="#pablo"
                                  target="_blank"

                                  onClick={e => e.preventDefault()}
                              >
                                  <i className={"fab fa-twitter"} />
                              </Button>
                              <Button

                                  href="#pablo"
                                  target="_blank"

                                  onClick={e => e.preventDefault()}
                              >
                                  <i className={"fab fa-facebook"} />
                              </Button>
                              <Button

                                  href="#pablo"
                                  target="_blank"

                                  onClick={e => e.preventDefault()}
                              >
                                  <i className={"fab fa-google-plus-g"} />
                              </Button>
                          </div>
                      </Paper>
                      <Paper elevation={3}
                      style={{
                          minHeight:"70vh",
                          minWidth: 450
                      }}>Hii</Paper>
                  </Grid>

              </Grid>
          </div>
      </div>
  );
}

export default App;
